import React,{Component} from 'react';
import {
    ListWidget,
    ListItem,
    ListItemText

} from '../style';
class List extends Component{
    render(){
        return (
           <ListWidget>
               <ListItem>
                    <img src='https://upload-images.jianshu.io/upload_images/2257068-610cbe7de087b61c?imageMogr2/auto-orient/strip|imageView2/1/w/360/h/240' alt='' />
                   <ListItemText></ListItemText>
               </ListItem>
           </ListWidget>
        )
    }
}   
export default List;
